import React from 'react'
//import Heder from './Heder'
import DarkLightToggle from './DarkLightToggle'

function App() {
  return (
    <div className='flex'>
      <div className='bg-slate-500 w-96'>
        <DarkLightToggle></DarkLightToggle>
      </div>
      <div className='right bg-amber-400 '>
      <div className='bg-sigLight dark:bg-sigDark w-16 h-10'></div>
      </div>
    </div>
  )
}


export default App
